description:
Groupie (2010)  

Verenigde Staten
Thriller
90 minuten

geregisseerd door Mark L. Lester
met Taryn Manning, Hal Ozsan en Eric Roberts

Riley Simms (Taryn Manning) krijgt eindelijk de kans om zichzelf waar te maken als zangeres van de hardcore band &quot;The Dark Knights&quot;. Een geweldsgolf vergezelt echter de langverwachte comeback-tour van de groep. De vraag is of hun nieuwe zangeres hier iets mee te maken heeft.

